contracts/StorageContractMethods.sol.content:
//SPDX-License-Identifier: UNLICENSED

pragma solidity ^0.8.0;

import "./StorageContractA.sol";

contract StorageContractMethod { 
    StorageContractA public storageContractAInstance;

    function getStorageContractA() public view returns(string memory) {
        return storageContractAInstance.stringAvalue1();
    }


    function getStorageContractB() public view returns (string memory) {
        bytes memory getValueData = abi.encodeWithSignature("stringBvalue1()");
        (bool success, bytes memory returnData) = address(storageContractAInstance).staticcall(getValueData);
        require(success, "Call to get stringBvalue1 failed");
        string memory value = abi.decode(returnData, (string));
        return value;
    }

    function setStorageContractA(string memory value) public {
        storageContractAInstance.setStringAValue1(value);
    }

    // Set the address of the existing StorageContractA instance
    function setStorageContractAInstance(address payable  _storageContractAAddress) public {
        storageContractAInstance = StorageContractA(_storageContractAAddress);
    }

    //     function setStorageContractB(string memory value) public {
    //     stringBvalue1 = value;
    // }
}

contracts/StorageContractA.sol.content:
//SPDX-License-Identifier: UNLICENSED

pragma solidity ^0.8.0;

contract StorageContractA { 
   bytes32 private constant IMPLEMENTATION_KEY = keccak256("set.implementation.initiator");

    string public stringAvalue1 = "string value of A 1";
    string public stringAvalue2 = "string value of A 2";
    string public stringAvalue3 = "string value of A 3";


    function setImplementation(address _implementation) public {
        // calleeAddress = _implementation;
        bytes32 key = IMPLEMENTATION_KEY;
        assembly {
            sstore(key, _implementation)
        }
    }

    function setStringAValue1(string memory value) public {
        stringAvalue1 = value;
    }

    function getImplementation() public view returns (address _implementation) {
        bytes32 key = IMPLEMENTATION_KEY;
        assembly {
            _implementation := sload(key)
        }
    }

    fallback() payable external {
        address implementation = getImplementation();
        require(implementation != address(0), "ERROR_IMPLEMENTATION_NOT_FOUND");

        assembly {
            let pointer := mload(0x40)
            calldatacopy(pointer, 0, calldatasize())
            let result := delegatecall(gas(), implementation, pointer, calldatasize(), 0, 0)
            let size := returndatasize()
            returndatacopy(pointer, 0, size)

            switch result
            case 0 { revert(pointer, size) }
            default { return(pointer, size) }
        }
    }
}

